Actionscript.script:
_parent.UpdateBigSmallState("技能中","瞬步斩一段中");

if(_parent.mp >= _parent.mp满血值)
{
	mp溢出 = _parent.mp - _parent.mp满血值;
	_parent.mp -= mp溢出;
	_root.主角mp显示界面.刷新显示();
}
else
{
	mp溢出 = 0;
}

onClipEvent(load){
   声音 = "";
   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "";
   子弹种类 = "红色剑气1";
   子弹威力 = 300 + _parent._parent.空手攻击力 + _parent._parent.刀属性.power * 1;
	if(_parent._parent.mp攻击加成){
		子弹威力 += _parent._parent.mp攻击加成;
	}
   子弹速度 = 15;
   击中地图效果 = "";
   Z轴攻击范围 = 30;
   击倒率 = 0.01;
   击中后子弹的效果 = "空手攻击火花";
   击退初速度 = 12;
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果,击退初速度);
}

