onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";

	自机 = _root.获得父节点(this,2);
	mp溢出加成 = _parent.mp溢出 * 2;
	子弹属性.子弹威力 = 自机.空手攻击力 * 0.1 + 900 + 自机.刀属性.power * 1.5 + mp溢出加成;

	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 10;

	子弹属性.区域定位area = this.area;
	_root.子弹区域shoot传递(子弹属性);
}
